(231, 45, 'As qualifications were cancelled on Saturday our ambassador Nicolas Ivanoff came by our booth to sign autographs for hundreds of fans. \nSadly he was declared unfit to fly on Race day due to illness, but nevertheless remains 3rd in overall ranking. See you in Budapest! #HamiltonWatch #airrace #nicolasivanoff\n\n6/4(土)のレース予選は、悪天候によりキャンセルとなりましたが、チーム ハミルトンのパイロット ニコラス・イワノフがハミルトン特設ブースでサイン会を行い、大勢のファンとの交流を楽しみました。残念ながら、6/5(日)の決勝は体調不良によるドクターストップで棄権となってしまいましたが、シーズン総合第3位につけるイワノフの次回ブタペスト戦にご期待ください！引き続きチーム ハミルトンに温かいご声援をお願いします！', '', 'image146522234114.jpg', 'https://www.instagram.com/p/BGRnWtKNXT4', '', '1', 0, 0, 0, 'as-qualifications-were-cancelled-on-saturday-our-ambassador-nicolas-ivanoff-came-by-our-booth-to-sign-autographs-for-hundreds-of-fans-sadly-he-was-declared-unfit-to-fly-on-race-day-due-to-illness-but-', '', '', '', '', '', 'rgba(76, 68, 45, 0.9)', 0, 1465222342, 1465134935, 2, '716e4ebc880017e4afdbd397790d3d52'),
