(244, 93, 'Breitling Super Avenger II - Swiss selfwinding chronograph', '', 'img_575584d1f0bf2.jpg', 'https://www.facebook.com/TBirdJewels/posts/772731329495786', '', '1', 0, 0, 0, 'breitling-super-avenger-ii-swiss-selfwinding-chronograph', '', '', '', '', 'If you are looking for a new men''s watch come see what we have from Breitling Call us today 702-256-3900 \n\nThe ideal companion for all manner of challenges, the Super Avenger II chronograph combines an imposing 48 mm diameter with a powerful and extremely professional aesthetic. Its steel case water-resistant to 300 m (1,000 ft) is geared up for the most extreme missions thanks to its rugged construction, it''s screwed-in pushpiece guards and its solid screw-lock crown with non-slip grip. \n\nThe selfwinding chronograph movement is chronometer-certified by the COSC, the only industry benchmark in terms of precision and reliability based on an international standard.', 'rgba(0, 0, 0, 0.9)', 0, 1465222358, 1464888907, 2, '601a2db552852decb3482f4c5742c57a'),
(245, 93, 'Skydive Dubai', '', 'img_575584d274e9e.jpg', 'https://www.facebook.com/Breitling/posts/1413471052011717', '', '1', 0, 0, 0, 'skydive-dubai', '', '', '', 'https://video.xx.fbcdn.net/v/t42.1790-2/13353506_905708789552059_1506744063_n.mp4?efg=eyJybHIiOjMwOSwicmxhIjo1MTIsInZlbmNvZGVfdGFnIjoic3ZlX3NkIn0%3D&rl=309&vabr=172&oh=b5146e291892cd1dc2ee6c47b645b55d&oe=57577EC2', 'Watch the Breitling Wingwalkers "Official" and Skydive Dubai take to the skies over Dubai!', 'rgba(86, 102, 99, 0.9)', 0, 1465222358, 1464876035, 2, 'cdd40e00a29f6212d17a2bb2671a9880'),
(246, 93, 'Photos from Breitling''s post', '', 'img_575584d307fb1.jpg', 'https://www.facebook.com/Breitling/posts/1413357765356379', '', '1', 0, 0, 0, 'photos-from-breitling-s-post', '', '', '', '', 'Discover the new Bentley B06 Midnight Carbon!\n\nThe beauty of black\n\nThe Bentley B06 was already distinguished by its Manufacture Breitling Calibre B06 with its exclusive “30-second chronograph” system. Its originality is now further accentuated in an all black-clad 500-piece limited series.\n\nMore information on: http://www.breitlingforbentley.com/en/collection/bentley-b06/versions/limited-editions/', 'rgba(2, 0, 3, 0.9)', 0, 1465222358, 1464868949, 2, 'cfe293906628317e951f5ec85e0785d7'),
(247, 93, 'Cover Photos', '', 'img_575584d3922e5.jpg', 'https://www.facebook.com/skydivedubaiskydivingteams/photos/a.366174910254793.1073741827.365243053681312/472005753005041/?type=3', '', '1', 0, 0, 0, 'cover-photos', '', '', '', '', 'Skydive Dubai and Breitling take to the skies over Dubai. Watch the short film here: http://www.skydivedubai.ae/skydivedubaiandbreitling/\n\n#SkydiveDubai #FlyBreitling', 'rgba(22, 22, 24, 0.9)', 0, 1465222358, 1464842044, 2, '3361902f5081c75b0ac93449d54193e7'),
