(249, 93, 'Avenger: Power in action\n\nAbsolute strength. Steely muscles. Pee', '', 'img_575584d57a032.png', 'https://www.facebook.com/Breitling/posts/1412459825446173:0', '', '1', 0, 0, 0, 'avenger-power-in-action-absolute-strength-steely-muscles-pee', '', '', '', '', 'Avenger: Power in action\n\nAbsolute strength. Steely muscles. Peerless performance. Outstanding precision. The Breitling Avenger is designed to offer a maximum of security and reliability. In creating the Avenger, Breitling has given prowess a new face that is resolutely technical, functional and sophisticated. \n\nMore information on the Avenger Bandit as well as the other Avenger models in the Breitling collection: http://www.breitling.com/en/models/avenger/avenger-bandit/', 'rgba(0, 0, 0, 0.9)', 0, 1465222358, 1464783518, 2, 'b17f0cae9561454dad58ebe95ed932a8'),
