(305, 36, 'Up close and personal with the new #BreguetClassique #HoraMundi #ref5727\n\nLink in bio to all new models. \nLaunched in 2011, The Breguet Hora Mundi introduces this year a new interpretation of the iconic world timer - the Classique Hora Mundi 5727. In place of a depiction of the globe, the silvered gold dial of this 2016 edition is entirely hand-engraved with 5 different types of engine-turned motifs, a perfect expression of Breguet’s traditional guilloche decoration techniques. Unlike other GMT watches, the uniqueness of this exceptional timepiece lies in its ingenious mechanism, for which four patent applications were filed. It represents the very first mechanical instant-jump time-zone watch with a mechanical memory providing synchronized displays of the date, day/night and city indications.', '', 'image146522449361.jpg', 'https://www.instagram.com/p/BGURSVQRISE', '', '1', 0, 0, 0, 'up-close-and-personal-with-the-new-breguetclassique-horamundi-ref5727-link-in-bio-to-all-new-models-launched-in-2011-the-breguet-hora-mundi-introduces-this-year-a-new-interpretation-of-the-iconic-worl', '', '', '', '', '', 'rgba(102, 98, 95, 0.9)', 0, 1465224497, 1465224028, 2, '3d1f4528d4fdd645e83a575de2ff4e9d');
