(306, 36, 'Baselworld 2016 – New Breguet Perles Impériales High Jewellery\n\nLink in bio to all new models. \nThis year, Breguet is paying homage to Empress Josephine – distinguished client of the House of Breguet – by introducing the new Perles Impériales High Jewellery watch. Adorned with sophisticated gemsetting techniques, this exquisite timepiece highlights the brand’s quest to constantly reinvent longstanding jewellery traditions in a contemporary manner. Alongside a total of almost 6 carats of diamonds, the model’s aesthetic refinement is further enhanced by a strikingly large pearl placed at 6 o’clock. The mother-of-pearl dial is decorated by hand with a delicate engine-turned motif reminiscent of dainty embroidery work. Available in both a white and rose gold variation, this novelty is fitted with a self-winding movement incorporating a silicon balance-spring.', '', 'image146522449436.jpg', 'https://www.instagram.com/p/BGMndVyxIfM', '', '1', 0, 0, 0, 'baselworld-2016-new-breguet-perles-impriales-high-jewellery-link-in-bio-to-all-new-models-this-year-breguet-is-paying-homage-to-empress-josephine-distinguished-client-of-the-house-of-breguet-by-introd', '', '', '', '', '', 'rgba(95, 87, 87, 0.9)', 0, 1465224497, 1464967217, 2, 'a40c6b0716c7306bd5baba08fb751636'),
(307, 36, 'Fifth Consecutive Award for #BreguetTradition #IndependentChronograph #ref7077\n\nOnce again, the magazine @RobbReport bestows the title of “Best of the Best” to a Breguet timepiece. The Tradition Chronographe Indépendant 7077 has unanimously earned the prestigious prize in the category “Conceptual Innovation.” This marks the fifth win for this timepiece, unveiled in 2015, after recognitions by Haute Time, L’Orologio, Revolution and GQ Spain. Those renowned magazines have indeed all honored this watch featuring an exceptional construction of two independent trains, dedicated to the time and the chronographe, beating respectively at 3Hz and 5Hz. \nThis prize pays tribute to the spirit of innovation which has driven the House for more than 240 years.', '', 'image146522449575.jpg', 'https://www.instagram.com/p/BGMIQRPxITr', '', '1', 0, 0, 0, 'fifth-consecutive-award-for-breguettradition-independentchronograph-ref7077-once-again-the-magazine-robbreport-bestows-the-title-of-best-of-the-best-to-a-breguet-timepiece-the-tradition-chronographe-i', '', '', '', '', '', 'rgba(2, 2, 4, 0.9)', 0, 1465224497, 1464950857, 2, '2da33f677c0db0eac0ee3ae97aa0afef'),
