(309, 36, '#TourbillonTuesday with the #BreguetClassique #GrandesComplications #Tourbillon #ref3358 \nCase in white gold set with 74 diamonds, housing a hand-wound movement with tourbillon, running seconds on the tourbillon shaft and compensating balance spring with Breguet overcoil. Dial in gold and engine-turned mother-of-pearl, individually numbered and signed, Breguet. Secret signature. Off-centre chapter ring with Breguet numerals.', '', 'image146522449787.jpg', 'https://www.instagram.com/p/BGE9TppxIT3', '', '1', 0, 0, 0, 'tourbillontuesday-with-the-breguetclassique-grandescomplications-tourbillon-ref3358-case-in-white-gold-set-with-74-diamonds-housing-a-hand-wound-movement-with-tourbillon-running-seconds-on-the-tourbil', '', '', '', '', '', 'rgba(0, 0, 0, 0.9)', 0, 1465224497, 1464710237, 2, '86a0f154afc497af1d10af1b177ba4f9'),
