(319, 94, 'Jaquet Droz celebrates the magnificent decorative art of paillon', '', 'img_57558ff9381b6.jpg', 'https://www.facebook.com/Jaquet.Droz/posts/10153688863898100:0', '', '1', 0, 0, 0, 'jaquet-droz-celebrates-the-magnificent-decorative-art-of-paillon', '', '', '', '', 'Jaquet Droz celebrates the magnificent decorative art of paillonné enameling. This landmark in artistry and watchmaking brings together the legends of the past with the finest of the present. Discover the new paillon models in limited edition now: http://bit.ly/25wbwaL\n#jaquetdroz #paillons #paillonneenamling #grandeseconde', 'rgba(0, 0, 0, 0.9)', 0, 1465225209, 1464685289, 2, '429558fb3d7da99a254bb69cd6144cd8'),
