(405, 260, 'Photos from Gucci''s post', '', 'img_5755987d13670.jpg', 'https://www.facebook.com/GUCCI/posts/10154066009771013', '', '1', 0, 0, 0, 'photos-from-gucci-s-post', '', '', '', '', 'The Gucci Cruise 2017 Party\nThe private party was held over three floors of an old London mansion at 106 Piccadilly, with a special performance by Annie Lennox in support of mothers2mothers charity. Here, a look at the guests.', 'rgba(95, 87, 87, 0.9)', 0, 1465227397, 1465133400, 2, 'bd0f7c4e03f3dc1c631a55811dd03b3b'),
(406, 260, 'Photos from Gucci''s post', '', 'img_5755987dc83de.jpg', 'https://www.facebook.com/GUCCI/posts/10154064254371013', '', '1', 0, 0, 0, 'photos-from-gucci-s-post_575598852f53b', '', '', '', '', 'Details of the Gucci Cruise 2017 Fashion Show\nBears, tigers and panthers encrusted in beads and appliquéd onto jackets and dresses, accessories marked with stripes and snakes, and pearls set in the GG belt; presenting a close-up look at details from the Cruise 2017 Fashion Show by Alessandro Michele.', 'rgba(95, 87, 87, 0.9)', 0, 1465227397, 1465049282, 2, 'bd0f7c4e03f3dc1c631a55811dd03b3b'),
(407, 260, 'The Gucci Cruise 2017 Collection', '', 'img_5755987e77a17.jpg', 'https://www.facebook.com/GUCCI/posts/10154062400666013', '', '1', 0, 0, 0, 'the-gucci-cruise-2017-collection', '', '', '', '', '“The collection is like a little poem to London. I have tried to put into it some of the pieces in my heart when I think about London: Victorian, schoolboy, crazy young noble guys and some romantic punk,” #AlessandroMichele\nA backstage point-of-view of the looks from the Gucci Cruise 2017 fashion show held in The Cloisters of Westminster Abbey.', 'rgba(95, 87, 87, 0.9)', 0, 1465227397, 1464968636, 2, 'd9a7a2c2855fd2448ee6606090176494'),
(408, 260, 'Guests at Gucci Cruise 2017', '', 'img_5755987f3f657.jpg', 'https://www.facebook.com/GUCCI/posts/10154060804196013', '', '1', 0, 0, 0, 'guests-at-gucci-cruise-2017', '', '', '', '', 'A look at the guests who attended the Gucci Cruise 2017 fashion show by Alessandro Michele held at The Cloisters in Westminster Abbey in London on June 2.', 'rgba(113, 99, 72, 0.9)', 0, 1465227397, 1464897148, 2, '9a40b76035f73ca85e3031316c168f7d'),
(409, 260, 'Gucci Cruise 2017', '', 'img_5755987fe0364.jpg', 'https://www.facebook.com/GUCCI/photos/a.10154060562706013.1073742105.44596321012/10154060562746013/?type=3', '', '1', 0, 0, 0, 'gucci-cruise-2017', '', '', '', '', 'Here, the complete gallery of every look from the Gucci Cruise 2017 Fashion Show, presented on June 2 at The Cloisters in Westminster Abbey in London.', 'rgba(49, 42, 34, 0.9)', 0, 1465227397, 1464889626, 2, '8e8ec78901bfe1f876a6e4458cddfede'),
(410, 260, 'Backstage at the Gucci Cruise 2017 fashion show at The Cloisters', '', 'img_575598808fd71.jpg', 'https://www.facebook.com/GUCCI/posts/10154060008876013:0', '', '1', 0, 0, 0, 'backstage-at-the-gucci-cruise-2017-fashion-show-at-the-cloisters', '', '', '', '', 'Backstage at the Gucci Cruise 2017 fashion show at The Cloisters in Westminster Abbey with Soko. Watch her story live on #Gucci’s #Snapchat today.', 'rgba(95, 87, 87, 0.9)', 0, 1465227397, 1464872400, 2, 'fe5ed3cc17a9c1b3c01efd2ef2999cec'),
