(530, 291, 'AW16 Pre Collection', '', 'img_5755a676e49c0.jpg', 'https://www.facebook.com/TheJennyPackham/posts/1277850428910852', '', '1', 0, 0, 0, 'aw16-pre-collection', '', '', '', '', 'The AW16 Pre Collection is inspired by the work of film director, Ang Lee. Lee’s films luxuriate in movement and scenery but it is his martial arts epic, Crouching Tiger, Hidden Dragon depicting the female heroine as a beacon of strength and beauty, alongside Lee’s use of exotic colours to coincide with emotion, that provided the inspiration for the season.\n\nNature itself is a kind of character; floral embroidered blooms adorn feminine dresses and separates, dragonflies and butterflies perch on webs of crystal and flowing tulle skirts twinkle with Swarovski. Sequins in rich hues of merlot red, stormy blue and textured metallics mimic the natural landscape whilst sleek silhouettes in crepe and silk satin add a tough sensually to the collection.\n\nJENNYPACKHAM.COM', 'rgba(41, 38, 45, 0.9)', 0, 1465230967, 1464777842, 2, 'd69a83bd177e6a5e3f2e8f2e7fd365e7'),
