(734, 159, 'KaleoseyeHunter By Kendall Jenner', '', 'img_5755b1df1f65c.jpg', 'https://www.facebook.com/kaleosasia/photos/a.752765378194415.1073741854.742864875851132/753882264749393/?type=3', '', '1', 0, 0, 0, 'kaleoseyehunter-by-kendall-jenner', '', '', '', '', 'KaleosEyehunters By Kendall Jenner\n\n不得不佩服， Kardashians 家族總是能成功炒話題，「豐臀金」金卡達夏 Kim Kardashian West去年全裸登上英國版《 GQ  》，兩個同母異父的妹妹，凱莉珍娜  Kylie Jenner先前才拍攝一組泳裝特輯，現在坎達爾珍娜 Kendal jenner更被邀請辣登美國版《 GQ 》5月號封面。\n\n說到坎達爾珍娜 Kendall Jenner.，絕對是今年度的"性感"關鍵字，19歲的她可是討論度最高的新生代模特兒，早在14歲就出道，近年走遍各大時尚品牌秀，包括 CHANEL 香奈兒、@FENDI、@OSCAR DE LA RENTA以及 ALEXANDER WANG等，去年更婉拒了維多利亞的秘密  Victoria''s Secret 美胸大秀，還成了雅詩蘭黛 Estee Lauder UK 最新代言人，讓她的模特兒事業再創高峰。\n\n究竟人氣有多高？現在她個人 Instagram就有高達2300萬的追蹤者，甚至高過姊妹淘卡拉迪樂芬妮 Cara Delevingne，除此之外，她的感情生活也是相當豐富，緋聞男友從一世代哈利 Harry Styles到籃球明星  Chandler Parsons，最近則是與小賈斯汀 Justin Bieber 打得火熱，把許多男明星魅得團團轉 ( 看看她有沒有哪天能比過泰勒絲 Taylor Swift？)，這回性感登上美國《GQ》，火辣辣穿上白色比基尼，或是上空雙手環胸，大方展現姣好身材，只能說無論是否靠爸靠媽，不能否認她確實有兩把刷子。\n圖片來源：#美國GQ\n\n#Kardashians #豐臀金 #金卡達夏 #KimKardashianWest #GQ #GQ雜誌 #CHANEL #香奈兒 #FENDI #OSCARDELARENTA #ALEXANDERWANG #VitoriaSecret #EsteeLauder #Instagram #卡拉迪樂芬妮 #ChandlerParsons #CaraDelevingne #HarryStyles #ChandlerParsons # JustinBieber #TalorSwift #GQ #May #Fashion #Kpop #Trendsetter #Topshelfproduc #Fashionmusthave #Entrylux #Mix&Match #Style #SuperModel', 'rgba(0, 0, 0, 0.9)', 0, 1465233892, 1465194254, 2, '97c86edec1c475bcb0e8e28ede4fec39'),
