(856, 140, 'Second-hand clothes on Aussie runway', '', 'img_5755bfc8de8bd.jpg', 'https://www.facebook.com/frockwriter/posts/1107464099276005', '', '1', 0, 0, 0, 'second-hand-clothes-on-aussie-runway', '', '', '', '', 'local "outrage" over Oscar de la Renta showing some of its pre-fall 2016 collection at #MBFWA: http://www.heraldsun.com.au/lifestyle/fashion/outrage-as-oscar-de-la-renta-serves-up-secondhand-clothes-for-australian-fashion-week/news-story/2e08ada3f7e4bff752fff3a6956dc677 on closer inspection, however, it appears almost half of the 50 exits had not been seen before on any runway. the 36-look ODLR pre-fall 16 collection: http://www.oscardelarenta.com/runway/pre-fall-2016  the complete MBFWA show: http://www.six6photography.com.au/Fashion16/mbfwa16ss/20May/OscarDeLaRentaRunway/index.html (and spring 2016: http://www.vogue.com/fashion-shows/spring-2016-ready-to-wear/oscar-de-la-renta#collection) apparently news corp didn''t get the see now buy now memo. NY-based australians TOME only showed their pre-fall 2016 collection at MBFWA, which had also first been unveiled in december, promoting it as see now buy now. the term technically denotes new merchandise that is available to consumers immediately, not already-shown merchandise promoted in season, however the lines are starting to get a little blurred.', 'rgba(189, 185, 184, 0.9)', 0, 1465237459, 1465080043, 2, '147dfdb4ae7a370bf366987bdb58738e'),
