(884, 136, 'Versace 7 Days 7 Dresses with Nina Suess', '', 'img_5755bfe010810.jpg', 'https://www.facebook.com/versace/posts/10156934994730176', '', '1', 0, 0, 0, 'versace-7-days-7-dresses-with-nina-suess', '', '', '', '', 'Start the week in style. Nina Suess in a vibrant Versace shift dress with block color detailing, perfect for busy Mondays. #7D7D\nShop the dress here: http://goo.gl/G3ll8z', 'rgba(39, 93, 5, 0.9)', 0, 1465237475, 1465229315, 2, 'ef9dee3fc662b6c537274c708d7428da'),
(885, 136, 'Versace is proud to present its Fall / Winter 2016 campaign shot', '', 'img_5755bfe0c81dd.jpg', 'https://www.facebook.com/versace/posts/10156931822235176:0', '', '1', 0, 0, 0, 'versace-is-proud-to-present-its-fall-winter-2016-campaign-shot', '', '', '', '', 'Versace is proud to present its Fall / Winter 2016 campaign shot by Bruce Weber. The campaign stars Gigi Hadid, Karlie Kloss and Dilone in a series of tableaux, some real-life and some fantastical. The combination perfectly illustrates the relevance and wearability of modern Versace for all parts of one’s life, from the ultra-glamourous to the everyday.\n\nPhotographer: Bruce Weber\nArt Director: Sam Shahid\nWomen Talent: Gigi Hadid, Karlie Kloss\nMan Talent: Marcus Watts\nWomen''s Stylist: Jacob K\nMen''s Stylist: David Bradshaw\nMakeup: Gucci Westman\nHair: Orlando Pita', 'rgba(57, 70, 40, 0.9)', 0, 1465237475, 1465150127, 2, 'affaa16b1285cd93488c23e5824e2a2a'),
(886, 136, 'Versace FW16 Show Collection', '', 'img_5755bfe174e91.jpg', 'https://www.facebook.com/versace/videos/10156916102640176/', '', '1', 0, 0, 0, 'versace-fw16-show-collection', '', '', '', 'https://video.xx.fbcdn.net/v/t42.1790-2/13348018_1020326611391486_349202763_n.mp4?efg=eyJybHIiOjQxOSwicmxhIjo1MTIsInZlbmNvZGVfdGFnIjoic3ZlX3NkIn0%3D&rl=419&vabr=233&oh=5959ee0262c74de8e91e20ce9753610c&oe=57577F71', 'Straight from the FW16 runway and with a limited availability, The most sought-after, buzzed-about looks from the latest women''s show can now be yours now. Find them at your nearest #Versace boutique http://goo.gl/oaokMG\n\nVideo produced by FASHION TO MAX', 'rgba(144, 117, 106, 0.9)', 0, 1465237475, 1464966000, 2, '83f649525b24f030fceab61240322b80'),
(887, 136, '#VersaceEditorials - #AtelierVersace takes on a sartorial edge i', '', 'img_5755bfe20de86.jpg', 'https://www.facebook.com/versace/posts/10156919795250176:0', '', '1', 0, 0, 0, 'versaceeditorials-atelierversace-takes-on-a-sartorial-edge-i', '', '', '', '', '#VersaceEditorials - #AtelierVersace takes on a sartorial edge in Vogue Paris - June/July ''16\nStylist - Géraldine Saglio\nPhoto - Inez&Vinoodh\nModel - Anna Ewers', 'rgba(18, 9, 10, 0.9)', 0, 1465237475, 1464879712, 2, '7d2a4d5b058e3116fe450d1635ad83a0'),
(888, 136, '#Versace Womenswear  Day to Night', '', 'img_5755bfe297267.jpg', 'https://www.facebook.com/versace/videos/10156912546140176/', '', '1', 0, 0, 0, 'versace-womenswear-day-to-night', '', '', '', 'https://video.xx.fbcdn.net/v/t42.1790-2/13353086_1428289863863717_1981021366_n.mp4?efg=eyJybHIiOjMwMCwicmxhIjo1MTIsInZlbmNvZGVfdGFnIjoic3ZlX3NkIn0%3D&rl=300&vabr=149&oh=d552cc9ec8abb9124724535585167f8e&oe=575772CC', 'The #Versace woman is versatile and her wardrobe reflects her moods and needs. Day-to-night looks take her straight from the corporate world to evening events with effortless ease and character. \nFind more:  goo.gl/9x9tzI', 'rgba(151, 151, 151, 0.9)', 0, 1465237475, 1464793200, 2, '7592e31d1470f3a5672d63adca4d5235'),
(889, 136, '#VersacePalazzoEmpire', '', 'img_5755bfe341780.jpg', 'https://www.facebook.com/versace/videos/10156913026285176/', '', '1', 0, 0, 0, 'versacepalazzoempire', '', '', '', 'https://video.xx.fbcdn.net/v/t42.1790-2/13345902_224904487902189_1586955194_n.mp4?efg=eyJybHIiOjMwMCwicmxhIjo1MTIsInZlbmNvZGVfdGFnIjoic3ZlX3NkIn0%3D&rl=300&vabr=99&oh=1330131017dec8147b1042644ce0ae66&oe=57577599', 'Step into style with the #VersacePalazzoEmpire bag. Art by OracleFox.', 'rgba(215, 214, 212, 0.9)', 0, 1465237475, 1464712332, 2, 'd43633bcefd8cd0fe8995621963d8dbe'),
(890, 137, 'MODERN ACCESSORIES FOR THE MODERN WOMAN', '', 'img_5755bfe53a162.jpg', 'https://www.facebook.com/valentino/posts/10154072176201131', '', '1', 0, 0, 0, 'modern-accessories-for-the-modern-woman', '', '', '', '', 'Today’s modern woman calls for chic practicality and timeless style. The new accessories for Fall 2016 offers a romantic Valentino Garavani Kimono1997 bag with Floral print intarsia, while the new Rockstud Untitled sneaker are updated with golden studs. The new Love Latch ballerinas show a softer more feminine aesthetic allowing function and style to coexist. \nDiscover how craftsmanship meets casual in the form of unique Fall 2016 accessories here: m.valentino.com/go/vq33rg', 'rgba(95, 87, 87, 0.9)', 0, 1465237479, 1465229968, 2, 'aadcbe8c413198a57ad1d36f67649864'),
(891, 137, 'Photos from Valentino''s post', '', 'img_5755bfe5adaaa.jpg', 'https://www.facebook.com/valentino/posts/10154061181651131', '', '1', 0, 0, 0, 'photos-from-valentino-s-post', '', '', '', '', 'BLOOMING SPRING FLOWERS\n\nA reinterpreted Kimono created by Valentino Garavani in 1997 marks the beginning of a movement that brings blooming stems on camel coats, blue peacoats, sleek trenches and black dresses: the Kimono 1997 collection. Kimono floral appliqué and special embroidery with fringed flowers and golden threads, are applied on brocades, felt and heavy lace creating a series of unique, yet romantic garments. \nBe enchanted by the new Valentino Kimono 1997 collection here: m.valentino.com/go/2fisey', 'rgba(128, 128, 136, 0.9)', 0, 1465237479, 1464969600, 2, '6dafae90e8d9870fa82931c7913d09d3'),
(892, 137, 'Photos from Valentino''s post', '', 'img_5755bfe64335b.jpg', 'https://www.facebook.com/valentino/posts/10154061180401131', '', '1', 0, 0, 0, 'photos-from-valentino-s-post_5755bfe7bf933', '', '', '', '', 'CADY AND EMBROIDERIES\n\nThe  Spring/Summer 2016 collection is an introspective journey through emotions and spirituality, sensuality and the human touch, a persistent research of beauty as an expression of virtue. The Maison’s value of  refinement, individuality and timeless elegance find their maximum expression in a series of very minimal cady dresses and flowing tulle gowns where beads and feathers create magical embroidered motifs. www.valentino.com', 'rgba(19, 19, 19, 0.9)', 0, 1465237479, 1464883200, 2, '6dafae90e8d9870fa82931c7913d09d3'),
(893, 137, 'A UNIQUE MOTIF', '', 'img_5755bfe6e119a.jpg', 'https://www.facebook.com/valentino/posts/10154061238266131', '', '1', 0, 0, 0, 'a-unique-motif', '', '', '', '', 'A new print makes its way into the Fall 2016 Collection, the Tie & Dye Collection keeps in mind the Maison’s savoir faire and the Valentino Atelier as a distinctive element inspired from the original tie-dye technique which became popular in the ‘60s and ‘70s.  The result is an original collection made of contrasting motifs developed on men’s accessories such as practical backpacks and  distinctive sneakers. Find the perfect Fall 2016 creation with a unique tie-dye motif here: m.valentino.com/go/0nkv8h', 'rgba(59, 19, 28, 0.9)', 0, 1465237479, 1464797881, 2, 'c065dc99eedab88f8f9a305e6172eb6f'),
(894, 137, 'WORLDWIDE MAGAZINES', '', 'img_5755bfe7bcb31.jpg', 'https://www.facebook.com/valentino/photos/a.10154059241091131.1073742550.177503626130/10154059241211131/?type=3', '', '1', 0, 0, 0, 'worldwide-magazines', '', '', '', '', 'Creative Directors, Maria Grazia Chiuri and Pierpaolo Piccioli, together with their unmistakable creations are featured on the covers of selected worldwide magazines. Covers range from the pure grace of the Spring/Summer 2016 to the pop and chic vibes of the Fall 2016 collection all showcasing univocally the complex yet crystalline allure of the Valentino woman. www.valentino.com', 'rgba(95, 87, 87, 0.9)', 0, 1465237479, 1464766071, 2, 'ae9c2aafad477abe7f703b97c50821d4'),
