(1107, 198, 'Manic Mani: Cushnie et Ochs SS16 Runway inspired this spring n...', '', 'img_5755d0d150d99.jpg', 'https://www.facebook.com/hellobeautifulofficial/videos/10154315802058846/', '', '1', 0, 0, 0, 'manic-mani-cushnie-et-ochs-ss16-runway-inspired-this-spring-n', '', '', '', 'https://video.xx.fbcdn.net/v/t42.1790-2/13354590_1003132946437575_234563439_n.mp4?efg=eyJybHIiOjMwMCwicmxhIjo1MTIsInZlbmNvZGVfdGFnIjoic3ZlX3NkIn0%3D&rl=300&vabr=126&oh=2e752578cb6ad20575d0e2cb57b96ee4&oe=57579715', 'The CUSHNIE ET OCHS runway inspired our nail trends. Spring into summer with this nail trend that will have your nails ready for the beach! Beauties, tag us on Instagram @HelloBeautiful if you try this easy to achieve look!', 'rgba(135, 104, 122, 0.9)', 0, 1465241812, 1464980697, 2, '9ba63779c471788da30595f9b6b92738'),
