(1249, 369, 'MOSCHINO OPENS NEW FLAGSHIP STORE IN MILAN!', '', 'img_5755dbf116ca6.jpg', 'https://www.facebook.com/MOSCHINO.officialpage/posts/10154257215585990', '', '1', 0, 0, 0, 'moschino-opens-new-flagship-store-in-milan', '', '', '', '', 'Milan, June 6th 2016. Moschino announces the opening of its new flagship store on Via Sant’Andrea in Milan, the symbol of a complete and engaging shopping experience that brings together Moschino and Boutique Moschino collections, ranging from ready-to-wear to accessories, textiles to beach wear and  jewelry to fragrances and eyewear. \nThe 700 square meter space encompasses two floors; the ground floor is dedicated entirely to the Couture line, while the upper floor contains the Men''s collection, Boutique Moschino and the Baby Kid & Teen selection. \nThe new flagship store on Via Sant’Andrea is the brand''s third and most important point of sales in the Italian fashion capital, joining the Moschino store which opened last year in Porta Nuova and the Love Moschino store on Corso Venezia. \nThe interior reflects the ironic and visionary concept of Creative Director Jeremy Scott; the idea that the retail space is an art gallery thus embracing the contemporary pop aesthetic and spirit, combining the function of a display space with the design of specially-made furnishings and accents, inspired by the brand''s iconic objects. \nThe store has a clean minimal aesthetic that allows for the iconic products and playful display cases to take the spotlight. Glossy cement floors are encircled by tall white ceilings and walls – a gallery of luxury leathers, hand-crafted collector’s items and classic gold Moschino lettering that allows the customer to shop in a curated and interactive space. It is both a retail and artistic experience.\nOversized MOSCHINO logos in giant 3D forms are affixed vertically to the walls.  Shopping bags are transformed into  various oversized shelving units that contain signature accessories.  The fitting room area, on the ground floor, is a giant white Moschino biker bag with a zipper opening that allows customers to enter. Another oversized biker bag dominates the window looking onto the street, while giant pumps with shelving and cushioned seats are used to display footwear. \nExtra-large chrome hangers ironically double as clothing racks for actual sized hangers of the coveted Moschino ready-to-wear pieces. Perhaps the most remarked-upon feature, two 3.5 meter-tall female mannequins grace the windows and double as centerpieces in the gallery-like space, wearing the most recent collection.\nOn the upper floor, next to the Men''s collection and Boutique Moschino line, Jeremy Scott created an enormous toy chest in the shape of a teddy bear covered with soft fur dedicated to the Baby Kid & Teen collections. It is fitted with a miniature door for children and a second entrance to a parallel walkway for parents.  \n\nMoschino \nVia Sant’Andrea 25\nTel +39 0276022639', 'rgba(202, 207, 203, 0.9)', 0, 1465244663, 1465225771, 2, 'c50830c480ecff4c66179e049067f954'),
