(1326, 387, 'Bette Midler, Vera Wang, and More Tell the Story of the Iconic Norma Kamali', '', 'img_5755dedf929d5.jpg', 'https://www.facebook.com/VogueRunway/posts/10155055381269896', '', '1', 0, 0, 0, 'bette-midler-vera-wang-and-more-tell-the-story-of-the-iconic-norma-kamali', '', '', '', '', 'Today, Norma Kamali will be honored with the Council of Fashion Designers of America (CFDA)''s Geoffrey Beene Lifetime Achievement Award. In honor of the recognition, Vogue.com caught up with some of the people who have known Kamali best. Read on for her singular story in their words. http://vogue.cm/lXOGKIC', 'rgba(202, 210, 201, 0.9)', 0, 1465245409, 1465225253, 2, '7838aaac5378d263fc8ed1dfa9f90547'),
(1327, 387, 'Ok. This fishtailed dress is a win-win for me. This is me at Car', '', 'img_5755dee0490ef.jpg', 'https://www.facebook.com/photo.php?fbid=10208107153409819&set=o.79361106376&type=3', '', '1', 0, 0, 0, 'ok-this-fishtailed-dress-is-a-win-win-for-me-this-is-me-at-car', '', '', '', '', 'Ok. This fishtailed dress is a win-win for me. This is me at Carnegie Hall February 11 wearing this amazing dress with fringed faux leather belt from BCBG.  And I''m wearing it again at the BMI pop awards with my son Jordan. Who won an award that night. It is a rocking dress and I adore it   Got lots of Ms K  right into here\nwww.sweethoneyintherock.org. #Loveinevolution', 'rgba(145, 121, 95, 0.9)', 0, 1465245409, 1464903163, 2, '4f59abf88622188b1c851e7bad6a80dd'),
