(1449, 413, 'Preview #RobertoCavalliResort17 by #PeterDundas - The collection', '', 'img_5755ea0b92f83.jpg', 'https://www.facebook.com/RobertoCavalli/posts/10153665933998061:0', '', '1', 0, 0, 0, 'preview-robertocavalliresort17-by-peterdundas-the-collection', '', '', '', '', 'Preview #RobertoCavalliResort17 by #PeterDundas - The collection is an eclectic mix recalling 70’s hippie couture and London’s 70’s elite. Eclectic panels of clashing prints and lace are patchworked together to create a 90’s bias louche.\nPhotographer: Edouard Plongeon', 'rgba(29, 8, 5, 0.9)', 0, 1465248270, 1464809401, 2, 'eca1f0f20c875ddd6e72c5c51058ad06'),
(1450, 413, 'Preview #RobertoCavalliResort17 by #PeterDundas - A melding of S', '', 'img_5755ea0c76288.jpg', 'https://www.facebook.com/RobertoCavalli/posts/10153665933613061:0', '', '1', 0, 0, 0, 'preview-robertocavalliresort17-by-peterdundas-a-melding-of-s', '', '', '', '', 'Preview #RobertoCavalliResort17 by #PeterDundas - A melding of South American spirited and 70’s inspired psychedelic embellished waistcoats give the collection a youthful ease. Long spiraling tie-dye, and blue on white broderie anglaise sun dresses for heady garden parties express innocence, sensuality, romance, and turn of the century classism.\nPhotographer: Edouard Plongeon', 'rgba(72, 60, 12, 0.9)', 0, 1465248270, 1464786000, 2, '0f71260194498edda621740c6e00f312'),
(1451, 413, 'Preview #RobertoCavalliResort17 by #PeterDundas - For Spring the', '', 'img_5755ea0d5084e.jpg', 'https://www.facebook.com/RobertoCavalli/posts/10153665932928061:0', '', '1', 0, 0, 0, 'preview-robertocavalliresort17-by-peterdundas-for-spring-the', '', '', '', '', 'Preview #RobertoCavalliResort17 by #PeterDundas - For Spring the #CavalliGirl is in an exuberant mood: the silhouette is free spirited. Long, voluminous hippie dresses, punctuated with Chantilly lace, floating like exotic birds in saturated colors. \nPhotographer: Edouard Plongeon', 'rgba(44, 29, 6, 0.9)', 0, 1465248270, 1464775200, 2, '5656e268be4724ff93636d3e42fe0432'),
