(1624, 181, 'Two British heritage brands. One harmonious collaboration', '', 'img_5755f558e575b.jpg', 'https://www.facebook.com/Burberry/videos/10154127648846425/', '', '1', 0, 0, 0, 'two-british-heritage-brands-one-harmonious-collaboration', '', '', '', 'https://video.xx.fbcdn.net/v/t42.1790-2/13399311_881267058649766_63179633_n.mp4?efg=eyJybHIiOjMwMCwicmxhIjo1MTIsInZlbmNvZGVfdGFnIjoic3ZlX3NkIn0%3D&rl=300&vabr=87&oh=7041d05cf3553c037542ec9a630bdfd6&oe=575832F8', 'Two British heritage brands. One harmonious collaboration\n\nBurberry has joined forces with Bowers & Wilkins, maker of luxury sound equipment, to create a limited-edition case and speaker set. Exclusively available at 15 Burberry stores worldwide and at Bowers & Wilkins'' online store.\n\nDiscover the collaboration: brby.co/4ux', 'rgba(95, 87, 87, 0.9)', 0, 1465251162, 1465214088, 2, 'e13d4fbc17a5e3046f815386f832db7b'),
(1625, 181, 'Luke Edward Hall For Burberry 2016', '', 'img_5755f55965325.jpg', 'https://www.facebook.com/Burberry/videos/10154114975921425/', '', '1', 0, 0, 0, 'luke-edward-hall-for-burberry-2016', '', '', '', 'https://video.xx.fbcdn.net/v/t42.1790-2/13352132_706533202817768_160177097_n.mp4?efg=eyJybHIiOjM0MywicmxhIjo1MTIsInZlbmNvZGVfdGFnIjoic3ZlX3NkIn0%3D&rl=343&vabr=191&oh=23cf9ac814988bb28118017a53598b39&oe=57588078', 'For the first time, Burberry collaborates with British artist and Central Saint Martins alumnus Luke Edward Hall. Geometric lines and blocks of colour combine to reinterpret ‘A Patchwork’, the new runway collection.\n\nSee his unique artworks on display in our Burberry 121 Regent Street flagship store from Saturday 11 June', 'rgba(38, 52, 27, 0.9)', 0, 1465251162, 1464764400, 2, 'b67b3bd40df87aec4159e5ecba5b9477'),
(1626, 181, 'Photos from Burberry''s post', '', 'img_5755f55a2f713.jpg', 'https://www.facebook.com/Burberry/posts/10154115333931425', '', '1', 0, 0, 0, 'photos-from-burberry-s-post', '', '', '', '', 'A Patchwork.\n\nVivid, opulent and intricate – the new collection from Burberry, a celebration of British art and creativity.\n\nShot by Mario Testino, with original illustrations by British artist Luke Edward Hall, blurring painting and photography for the new Burberry campaign.  \n\nDiscover the new Burberry Collection: youtu.be/HE1o8ogmO6U', 'rgba(18, 12, 22, 0.9)', 0, 1465251162, 1464722178, 2, 'f27e6b3866c41be70b73110cb839f0ee'),
