(138, 92, 'yves-saint-laurent', 'Yves Saint Laurent', '', '', '', 'Fashion house Yves Saint Laurent opened its doors in Paris on New Year''s Eve in 1961.It was the birth of great and luxury brand, which is still popular among all over the world. This brand was created for those people who want to look elegant and practical at the same time even in a boring weekday.\nThe founder of the brand, Yves Saint Laurent , who was born in the most ordinary French family and moved to Paris in 17 years to conquer the world of bored modern fashion .Yves Saint Laurent has made a huge contribution to the history of modern fashion. Thanks to his bold and shocking, but always relevant design solutions we can enjoy transparent blouses, strict "masculine" costumes, black and white abstract graphic prints, and many others, which would not exist without this great French fashion designer. \nYves Saint Laurent is one of the most iconic brands in the history of fashion. In his great designer products embody all the most daring and original ideas ,solutions, which, undoubtedly, during the existence of the brand relished to fashionistas from all over the world.', 2),
